import Login from './Login'
import Logout from './Logout'
import Register from './Register'

export default function UserBar() {
    const user = '' // No user is logged in by default
    if (user) { return <Logout user={user} /> } 

    else {
        return (
            <>
              <Login />
              <Register />
            </>
        )
    }
}
